I don‚Äôt think this chapter has aged poorly; rather, it seems to have been misaligned from the start with the common understanding of data structures, the purpose of abstraction, and the principles of information hiding. public interface Point { double getX(); double getY(); void setCartesian(double x, double y); double getR(); double getTheta(); void setPolar(double r, double theta);
}
The beautiful thing about Listing 6-2 is that there is no way you can tell whether the implementation is in rectangular or polar coordinates. It might be neither! And yet the interface still unmistakably represents a data structure. There is nothing beautiful about this interface. An interface that exposes only getters and setters is often a design mistake . Interfaces should define a contract of behavior , not merely obfuscate the internal data structure. They should provide meaningful abstractions , not just hide implementation details. The fact that it's impossible to tell if this is about rectangular or polar coordinates is not true. It's both. The interface exposes both and the implementation is forced to support both. A more sensible design would separate these responsibilities: sealed interface Point;
record Rectangular(double length, double width) implements Point { }
record Polar(double r, double theta) implements Point {}; public Rectangular convert(Polar polar) {...}
public Polar convert(Rectangular rectangular) {...} Martin would say that "This exposes implementation. Indeed, it would expose implementation even if the variables were private and we were using single variable getters and setters." But the thing is that there is no implementation to be exposed, the Point is just data and its shape is essential to its meaning. In statically typed languages, explicitly communicating the shape of data through types is the goal. Not every abstraction needs to hide its data structure - sometimes the data structure itself is the abstraction. Hiding implementation is not just a matter of putting a layer of functions between the variables. Hiding implementation is about abstractions! Exactly! But introducing unnecessary abstractions is over-engineering. As Edsger Dijkstra put it: "The purpose of abstraction is not to be vague, but to create a new semantic level in which one can be absolutely precise." - Dijkstra 1972 The Point interface in the example creates no new semantic meaning. It conflates two coordinate systems into a vague abstraction without clear purpose. A good abstraction adds precision and reduces ambiguity‚Äînot the other way around. Consider Listing 6-3 and Listing 6-4. The first uses concrete terms to communicate the fuel level of a vehicle, whereas the second does so with the abstraction of percentage. Listing 6-3 Concrete Vehicle public interface Vehicle { double getFuelTankCapacityInGallons(); double getGallonsOfGasoline();
} Listing 6-4 Abstract Vehicle public interface Vehicle { double getPercentFuelRemaining();
} In both of the above cases the second option is preferable. We do not want to expose the details of our data. Rather we want to express our data in abstract terms. This is not about "details of our data", this is hiding our data! Depending on the context, this might be good or bad. For example, with the second option, it becomes impossible to calculate the cost of filling the tank. Are we designing for scammy car rentals? If so, then sure, hide the data. The assumption that hiding data is always a good thing is just wrong. Ineffective abstraction occurs when essential knowledge is removed, or when non-essential knowledge is unnecessarily exposed - or both.

