} Again in modern language there is no need to create DSL as the language is powerful enough to make code concise and readable: @Test
def turnOnLoTempAlarmAtThreashold() { hw.setTemp(10.F) // too cold controller.tic() assertEquals( Status(heaterOn = true, blowerOn = false, coolerOn = false, hiTempAlarm = false, loTempAlarm = true) hw.getState() )
} Final nit-pick: public String getState() { String state = ""; state += heater ? "H" : "h"; state += blower ? "B" : "b"; state += cooler ? "C" : "c"; state += hiTempAlarm ? "H" : "h"; state += loTempAlarm ? "L" : "l"; return state;
} StringBuffers are a bit ugly. Again the book age shows: StringBuffers are not only ugly they are also slow. StringBuffer are synchronized for multi-threaded access, even without contention it has runtime cost. Good news are his original code will be compiled by javac to use StringBuilders. There are things that you might never do in a production environment that are perfectly fine in a test environment. Usually they involve issues of memory or CPU efficiency. But they never involve issues of cleanliness. Test performance matters at scale - slow tests can significantly impact development velocity. The most important thing for tests to do is to actually test the software. But giving up tests performance in large code base means increase of validation cycle in CI/CD pipelines.

