The advocated principle is the title - the name should reveal intent. But the application: The name of a variable, function, or class, should answer all the big questions. It should tell you why it exists, what it does, and how it is used. If a name requires a comment, then the name does not reveal its intent. This sounds like an impossible task. First, the name that reveals all of those details fails to be an abstraction boundary. Second, what you notice in many examples in this book that this approach to naming leads to using "description as a name". Martin presents 3 versions of the same code: public List&lt;int[]&gt; getThem() { List&lt;int[]&gt; list1 = new ArrayList&lt;int[]&gt;(); for (int[] x : theList) if (x[0] == 4) list1.add(x); return list1;
} (Might be) Obfuscated and unrealistic public List&lt;int[]&gt; getFlaggedCells() { List&lt;int[]&gt; flaggedCells = new ArrayList&lt;int[]&gt;(); for (int[] cell : gameBoard) if (cell[STATUS_VALUE] == FLAGGED) flaggedCells.add(cell); return flaggedCells;
} (Migh be) Good enough public List&lt;Cell&gt; getFlaggedCells() { List&lt;Cell&amp;ht; flaggedCells = new ArrayList&lt;Cell&gt;(); for (Cell cell : gameBoard) if (cell.isFlagged()) flaggedCells.add(cell); return flaggedCells;
} (Might be) Premature abstraction My main disagreement is this: not all code chunks need a name. In modern languages, this method can be a one-liner: gameBoard.filter(cell => cell(STATUS_VALUE) == FLAGGED) That's it. This code can be inlined and used as is. Second, while getFlaggedCells looks like an improvement over obfuscated getThem, it's not really a name, it's a description of what the method does. If the description is as long as the code, it's often redundant. Martin writes about it in passing: "if you can extract another function from it with a name that is not merely a restatement of its implementation ". But he violates this principle quite often. Third, if for readability alone, I'd argue that the second version is as clear as the third. If readability is the only reason for introducing Cell abstraction, this is an overkill. To be fair there are good reasons to introduce Cell abstraction, but also there are reasons not to ‚Üì List&lt;int[]&gt; is a generic type - devoid of meaning without a context. List&lt;Cell&gt; - has more semantic meaning and is harder to misuse. List&lt;int[]&gt; list = getFlaggedCells();
list.get(0)[0] = list.get(0)[1] - list.get(0)[0]; This compiles and runs, but the transformation is non-sensical and will corrupt data (the first element is a status field). List&lt;Cell&gt; has a better affordance than List&lt;int[]&gt;, and makes such mistakes less likely. But improved affordance comes from the specialized type, not just the name. But there is a the downside - specialized types needs specialized processing code. &nbsp; Serialization libraries, for example, would have support for List&lt;int[]&gt; out of the box, but would need custom ser-de for the Cell class. Since Clean Code, Robert Martin has embraced Clojure and functional programming. One of the tenets of Clojure philosophy: use generic types to represent the data and you'll have enormous library of processing functions that can be reused and combined. I'm curious if he would ever finish the second edition and if he had changed his mind about types.

