I believe this was my first big WTF moment in the book: Original Code: private void printGuessStatistics(char candidate, int count) { String number; String verb; String pluralModifier; if (count == 0) { number = "no"; verb = "are"; pluralModifier = "s"; } else if (count == 1) { number = "1"; verb = "is"; pluralModifier = ""; } else { number = Integer.toString(count); verb = "are"; pluralModifier = "s"; } String guessMessage = String.format( "There %s %s %s%s", verb, number, candidate, pluralModifier ); ‚ñ∫print(guessMessage);Instead of printing, the method should just return guessMessage String result &nbsp; &nbsp;
} Proposed rewrite: public class GuessStatisticsMessage { private String number; private String verb; private String pluralModifier;
&nbsp; public String make(char candidate, int count) { createPluralDependentMessageParts(count); return String.format( "There %s %s %s%s", verb, number, candidate, pluralModifier ); }
&nbsp; private void createPluralDependentMessageParts(int count) { if (count == 0) { thereAreNoLetters(); } else if (count == 1) { thereIsOneLetter(); } else { thereAreManyLetters(count); } }
&nbsp; private void thereAreManyLetters(int count) { number = Integer.toString(count); verb = "are"; pluralModifier = "s"; }
&nbsp; private void thereIsOneLetter() { number = "1"; verb = "is"; pluralModifier = ""; }
&nbsp; private void thereAreNoLetters() { number = "no"; verb = "are"; pluralModifier = "s"; }
} In no way the second option is better than the first one. The original has only one problem: side-effect. Instead of printing to the console it should have just return String. And that is it: 1 method, 20 lines of code, can be read top to bottom, 3 mutable local variables to capture local mutable state that can not escape. It is thread-safe. I's impossible to misuse this API. Second option: 5 methods, 40 lines of code, +1 new class with mutable state. Because it's a class, the state can escape and be observed from the outside. Which makes it not thread safe. The second option introduced more code, more concepts and more entities, introduced thread safety concerns.. while getting the exactly same results. It also violates one of the rules laid out in the chapter about method names: "Methods should have verb or verb phrase names". thereIsOneLetter() is not really a verb or a verb phrase. If I'll try to be charitable here: Martin is creating internal Domain Specific Language(DSL) for a problem. A good indicator of an internal DSL: there are parts of API that doesn't make sense outside specific context/grammar. For example, new GuessStatisticsMessage().thereAreNoLetters() looks weird and doesn't make sense. On the other hand, language consturcts are presented in a somewhat declarative style: private void thereAreNoLetters() { number = "no"; verb = "are"; pluralModifier = "s";
} private void thereIsOneLetter() { number = "1"; verb = "is"; pluralModifier = "";
} I hope you agree that methods like this is not a typical Java. If anything, this looks closer to typical ruby. At the end, OOP and DSL are the wrong tool for the task of creating string. In a powerful-enough language, keeping this code procedural gives you result that is short and easy to understand: def formatGuessStatistics(candidate: Char, count: Int): String = { count match { case i if i < 0 => throw new IllegalArgumentException(s"count=$count: negative counts are not supported") case 0 => s"There are no ${candidate}s" case 1 => s"There is 1 ${candidate}" case x => s"There are $x ${candidate}s" }
}
